/* Import two hooks, useEffect, useState */
import React, { useEffect, useState } from "react";

export const PeopleList = () => {
  const [people, setPeople] = useState([]);

  useEffect(() => {
    fetch("https://swapi.co/api/people/")
      /* Get json */
      .then(res => res.json())
      .then(json => {
        setPeople(json.results);
      });
  }, []);

  return (
    <div>
      {people.map(people => (
        <div>
          <h2>{people.name}</h2>
          <h2>{people.gender}</h2>
        </div>
      ))}
    </div>
  );
};
